// src/pages/HomePage.js
import React from 'react';
import Header from '../components/Header'; // Asegúrate de que la ruta es correcta
import plantImage from '../assets/plant.jpg'; // Asegúrate de que la ruta es correcta

const HomePage = () => {
  return (
    <div>
      <Header />
      <h1>Aprovecha y llévate una planta para tu jardín</h1>
      <img src={plantImage} alt="Planta para jardín" style={{ width: '100%', maxWidth: '600px', height: 'auto', marginTop: '20px' }} />
    </div>
  );
};

export default HomePage;
